import React from 'react'
import CategoriesData from './CategoriesData'

const CategoriesBar = () => {

    const newarr = CategoriesData.map((item) => (
    item.GetCategoryInfoResponse.map((t) => {
        return t.CategoryNamePath
    })
))
    console.log(newarr)
    return (
        <div className="Categories_Side_Container">
            <p>Categories</p>
            <p></p>
        </div>
    )


}

export default CategoriesBar
